hose who take longer rides but can only be benefited if they are members."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":236.139071,"end_time":"2022-06-15T12:13:00.825166","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-15T12:09:04.686095","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}